import React, { useEffect, useState } from "react";
import "./App.css";

const App = () => {
  const [student, setStudent] = useState([]);
  useEffect(() => {
    fetch(`http://localhost:5000/api/getInfo?limit=10`);
  }, []);
  return (
    <div>
      {student.map((p) => {
        return <div>{p.name}</div>;
      })}
    </div>
  );
};

export default App;
